import React from 'react';
import './SelectionOutput.css'; 
import { useLocation } from 'react-router-dom';

function SelectionOutput() {
  const location = useLocation();
  const roomsData = location.state ? location.state.roomsData : null;
  // Creating a row with 5 checkboxes
  const CheckboxRow = () => (
    <div className="checkbox-row">
      <input type="checkbox" />
      <input type="checkbox" />
      <input type="checkbox" />
      <input type="checkbox" />
      <input type="checkbox" />
    </div>
  );

  return (
    <div className="container">
      <h1>Bld. A, X fLOOR</h1>
      <CheckboxRow />
      <CheckboxRow />
      <CheckboxRow />
      <h1>Bld. B, Y fLOOR</h1>
      <CheckboxRow />
      <CheckboxRow />
      <CheckboxRow />
      <button className="submit-button">Submit</button>
    </div>
  );
}

export default SelectionOutput;
